@thistrond @MagnusPharao @PaulaLarrain1 @madsbrynnum @Karibuniii @BZDUBaggerTue Jeg forsøger som altid at læse så godt jeg nu engang kan.
Debatten startede proklamationer af hvornår en debat *ikke* er mulig. Det var det jeg reagerede på. 
Man kan vist ikke være uenig i, at det er en god strategi at holde fast i egne præmisser, i enhver politisk debat.

@quitte74 @PatrickArff Fair nok.
Men Torben; jeg forstod godt du blev sur over de ‘billige’ straffe i Parken.
Men det er svært at have medfølelse med en fan der så nogle måneder senere pludselig ‘forstår’ spillere der smider sig.
